import React from 'react';
import CategoryCard from '../../components/Admin/CategoryCard';
import NavAdmin from '../../components/Admin/NavAdmin';
import '../../styles/'

const CategList = () => {
    return (
        <div>
            <NavAdmin />
            <div className='CategList'>
            <ul>
               <CategoryCard /> 
            </ul>
        </div>
        </div>
    );
};

export default CategList;
